一開始對此相當反感，因為對該線上課程的期待是可以給我正確的答案，<br>
但因為版本的關係，變成要多花心力去找正確答案，<br>
一方面覺得多花時間，<br>
一方面當時身邊又沒有人可以即時請教，無力感相當重。<br><br>

其實沒有特別的處理方式，就是離開座位喝杯水，<br>
繼續google答案，因為問題就是擺在那邊，要往下走，<br>
